        'INSERT OR REPLACE INTO games (id,  name, startBook, startChapter, startVerse, endBook, endChapter, endVerse, nextBook, nextChapter, nextVerse, money, bonuses, versesCount, resolvedVersesCount,isDeleted)  VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?,?,?)',
